INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (0.0, 3001, 0, "vo_minigame_1012_result_2096", 3, 0, 1, 2, 2, "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！", 0, 3, 22300164);
